BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "users" (
	"ID"	INTEGER,
	"surname"	TEXT,
	"name"	TEXT,
	"registration_date"	TEXT
);
CREATE TABLE IF NOT EXISTS "titles" (
	"ID"	INTEGER,
	"title"	TEXT,
	"author_id"	INTEGER
);
CREATE TABLE IF NOT EXISTS "fines" (
	"ID"	INTEGER,
	"user_id"	INTEGER,
	"payment_date"	TEXT,
	"fine"	REAL
);
CREATE TABLE IF NOT EXISTS "borrowings" (
	"ID"	INTEGER,
	"user_id"	INTEGER,
	"book_id"	INTEGER,
	"borrow_date"	TEXT,
	"return_date"	TEXT
);
CREATE TABLE IF NOT EXISTS "books" (
	"ID"	INTEGER,
	"title_id"	INTEGER,
	"registration_date"	TEXT
);
CREATE TABLE IF NOT EXISTS "authors" (
	"ID"	INTEGER,
	"surname"	TEXT,
	"name"	TEXT
);
COMMIT;
